Ban(バン) 爽快さっぱりシャワーシート せっけんの香り 36枚入<br>ブランド：Ban(バン)<br>販売・製造元：ライオン<br><br>ナノイオン吸着パウダー配合、汗もニオイもベタつきもしっかりふけるデオドラントシートです。<br>ナノイオンパウダーが汗やニオイをしっかり吸着。<br>厚手*立体メッシューシートだから、1枚で全身の汗・ベタつき・ニオイまでしっかり取り除きます。<br>毛羽立ちにくく、肌にやさしいふき心地です。<br>シートにたっぷり含んだリフレッシュウォーターが、素肌を包み、長時間ひんやり爽快感が持続します。<br>肌がかさつきません。<br>また、パウダーの白残りもありません。<br>スポーツ後、学校やオフィス、人と会う前などに。<br>ワキの下、首筋、胸元など、全身にお使いいただけます。<br>せっけんの香り。<br> <br><br><br>使用方法<br>●シートを取り出し、お肌をふいてください。<br>●乾燥による品質の劣化を防ぐため、使用後は必ずシールを閉めてください。<br>開封後はなるべく早めに使いましょう。<br> ご注意<br>●粘膜や目のまわりへの使用は避け、また除毛直後や傷、はれもの、湿疹等、異常のあるときは使わないでください。<br>●使用中または使用後、刺激等の異常が現れたときは使用を中止し、商品を持参し医師に相談してください。<br>●アルコール過敏症の方、特にお肌の弱い方、乳幼児は使用しないでください。<br>●パウダーを使用していますので、万一衣服が白くなったときは、ハンカチか洋服ブラシで落としてください。<br>●シートは水に溶けないので、水洗トイレには流さないでください。<br>●夏場の車内など高温になるところや、直射日光の当たる場所には置かないでください。<br>●乳幼児の手の届くところに置かないでください。<br> <br>成分<br>水、エタノール、シリカ、BG、ジメチコン、メントール、PEG-60水添ヒマシ油、水酸化Na、エチルパラベン、プロピルパラベン、香料 <br><br>お問い合わせ先<br>ライオン株式会社0120-556-913 デオドラント(制汗剤)とは汗による気になるニオイを防ぎます。<br>汗をかく前に使うスプレータイプや汗を拭き取りタイプのシートなど。<br><br>日用品／デオドラント／デオドラントシート／化粧品<br>JANコード： 4903301169413<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
